import { Fragment } from 'react'
import styles from './Header.module.css';

export default function Header(props) {
    return (
        <Fragment>
            <header className={styles.header}>
                <h1>{props.title}</h1>
                <button onClick={props.onShowCart}>My Cart</button>
            </header>

            <div className={styles['main-image']}>
                <img src={props.image
                    ? props.image
                    : 'https://images.unsplash.com/photo-1517436073-3b1b1b1b1b1b?ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mnx8YmFja2dyb3VuZCUyMHBpY3R1cmV8ZW58MHx8MHx8&ixlib=rb-1.2.1&w=1000&q=80'
                } alt="A table full of delicious food" />
            </div>
        </Fragment>
    );
}
